response:
Based on the provided context documents, it appears that the requirement for one party to deposit its source code into escrow is mentioned in several documents.

Document 1, Section 16, "SOURCE CODE ESCROW" states: "Immediately upon execution of this Agreement, Garman shall maintain on each AS400 at an Authorized Location the most current version of: ...". This suggests that Garman is required to maintain the source code in escrow.

However, the release conditions for the escrowed source code are not explicitly mentioned in Document 1. To determine the release conditions, we need to refer to other documents.

Document 7, Section 8.6, lists the following events as "Release Conditions" for the purpose of releasing the source code from escrow:

(a) Supplier defaults on any of its maintenance obligations herein;
(b) Supplier ceases to provide maintenance for the Software;
(c) Supplier ceases doing business in the ordinary course, files or has filed against it a petition under bankruptcy Code, becomes insolvent or has a receiver appointed for all or a substantial part of its business;
(d) Bank of America terminates this Agreement for cause pursuant to the terms hereof.

These release conditions suggest that the escrowed source code can be released to the counterparty
